const columns: ColumnDef<User>[] = [
    {
        id: "select",
        header: ({ table }) => (
            <input
                type="checkbox"
                checked={table.getIsAllPageRowsSelected()}
                ref={el => { if (el) { el.indeterminate = !table.getIsAllPageRowsSelected() && table.getIsSomePageRowsSelected(); } }}
                onChange={e => table.toggleAllPageRowsSelected(e.target.checked)}
                className='text-center'
            />
        ),
        cell: ({ row }) => (
            <div className='text-center'>
                <input
                    type="checkbox"
                    checked={row.getIsSelected()}
                    ref={el => { if (el) { el.indeterminate = !row.getIsSelected() && row.getIsSomeSelected(); } }}
                    onChange={e => row.toggleSelected(e.target.checked)}
                    className='text-center'
                />
            </div>
        )
    },
    {
        accessorKey: "first_name",
        header: () => <div className='w-full text-start'>First Name</div>,
        cell: ({ row }) => (
            <div className="capitalize">{row.getValue("first_name")}</div>
        ),
    },
    {
        accessorKey: "last_name",
        header: () => <div className='w-full text-start'>Last Name</div>,
        cell: ({ row }) => (
            <div className="capitalize">{row.getValue("last_name")}</div>
        ),
    },
    {
        accessorKey: "gender",
        header: "Gender",
        cell: ({ row }) => (
            <div className="capitalize text-center">{row.getValue("gender")}</div>
        ),
    },
    {
        accessorKey: "language",
        header: "Language",
        cell: ({ row }) => (
            <div className="capitalize text-center">{row.getValue("language")}</div>
        ),
    },
]

export default function Page() {
    const [open_column_visibility, setOpenColumnVisibility] = useState(false)
    const [data, setData] = useState(DataExample);
    const [pagination, setPagination] = useState<PaginationState>({ pageIndex: 0, pageSize: 5, })
    const [columnVisibility, setColumnVisibility] = useState({})
    const [columnFilters, setColumnFilters] = useState<ColumnFiltersState>([])

    const table = useReactTable({
        data,
        columns,
        onColumnVisibilityChange: setColumnVisibility,
        onPaginationChange: setPagination,
        onColumnFiltersChange: setColumnFilters,
        getCoreRowModel: getCoreRowModel(),
        getPaginationRowModel: getPaginationRowModel(),
        getFilteredRowModel: getFilteredRowModel(),
        state: {
            columnVisibility,
            pagination,
            columnFilters,
        },
    })
    return (
        <div className="w-full max-w-screen-lg flex flex-col gap-4 p-2.5 rounded-sm shadow-sm drop-shadow-sm border border-gray-200 bg-white">
            <Table.Navigation>
                <Table.NavigationItems>
                    <Table.Pagination type="previous" onClick={() => table.previousPage()} disabled={!table.getCanPreviousPage()} />
                    <Table.Pagination type="next" onClick={() => table.nextPage()} disabled={!table.getCanNextPage()} />
                    <Table.ColumVisibility
                        on_trigger={() => setOpenColumnVisibility(!open_column_visibility)}
                        is_active={open_column_visibility}
                        all_columns_checked={table.getIsAllColumnsVisible()}
                        all_columns_on_change={table.getToggleAllColumnsVisibilityHandler()}
                        columns={table}
                    />
                    <Table.DataSearch search_by="first_name" table={table} />
                </Table.NavigationItems>
                <Table.NavigationItems>
                    <Table.DataCount data={table} />
                    <Table.DataShowSize
                        sizes={[5, 10, 20, 30, 40, 50]}
                        value={table.getState().pagination.pageSize}
                        onChange={e => { table.setPageSize(Number(e.target.value)) }}
                    />
                </Table.NavigationItems>
            </Table.Navigation>
            <Table>
                <Table.Header>
                    {table.getHeaderGroups().map(headerGroup => (
                        <Table.Row key={headerGroup.id}>
                            {headerGroup.headers.map(header => (
                                <Table.Head key={header.id}>
                                    {header.isPlaceholder
                                        ? null
                                        : flexRender(
                                            header.column.columnDef.header,
                                            header.getContext()
                                        )}
                                </Table.Head>
                            ))}
                        </Table.Row>
                    ))}
                </Table.Header>
                <Table.Body>
                    {table.getRowModel().rows?.length ? (
                        table.getRowModel().rows.map((row) => (
                            <Table.Row key={row.id} data-state={row.getIsSelected() && "selected"}>
                                {row.getVisibleCells().map((cell) => (
                                    <Table.Data key={cell.id}>
                                        {flexRender(cell.column.columnDef.cell, cell.getContext())}
                                    </Table.Data>
                                ))}
                            </Table.Row>
                        ))
                    ) : (
                        <Table.Row>
                            <Table.Data colspan={columns.length} className='text-center'> No results.</Table.Data>
                        </Table.Row>
                    )}
                </Table.Body>
            </Table>
        </div>
    )
}